import React from 'react';
import './Cards.css';

import Card from './Card.jsx';

export default function Cards({cities, onClose}) {
  if(cities){
    let cities=cities.cities;
    return (
      <div className='cards'>
        {cities.map(el => <Card
            max={el.max}
            min={el.min}
            name={el.name}
            img={el.img}
            onClose={() => onClose(el.id)}
            id={el.id}
          /> )}
      </div>
    );
  } else {
    return(
      <div>Sin ciudades</div>
    )
  }
}
